import { useEffect } from "react";
import * as S from "../styles/Profile.style";

function Profile() {
  let profileData = JSON.parse(localStorage.getItem("Profile Data"))
  useEffect(() => {
    console.log(profileData);
  }, [])
  return (
    <S.Box>
      {profileData.name} 님, 
      현재 키: {profileData.height}
      현재 몸무게: {profileData.weight}
      현재 {profileData.name} 님의 BMI는 {profileData.weight / (profileData.height) * (profileData.height)}입니다. 
    </S.Box>
  )
}

export default Profile;
